using namespace std;
 
const int maxl=3000+5;
class PalindromePartition {
public:
  char s[maxl],rev[maxl];
  int f[maxl],L;
  bool check(int a,int b)
  {
    return memcmp(s+a,rev+L+1-b,b-a+1)==0;
  }
  int partition(vector <string> vs)
  {
    int i,j,k;
    string str="";
    for (k=0;k<vs.size();k++)
      str+=vs[k];
    strcpy(s+1,str.c_str());
    L=strlen(s+1);
    f[0]=0;
    for (i=1;i<=L;i++)
      rev[i]=s[L+1-i];
    for (i=1;i<=L;i++)
    {
      f[i]=f[i-1]+1;
      for (j=0;j<i;j++)
        if (f[j]+1<f[i] && check(j+1,i))
          f[i]=f[j]+1;
    }
    return f[L];
  }
};

